import "./index.css";
import { useGlobalContext } from "./context";
import { fetchDataBase } from "./fetchData";

export const LogIn = () => {
  const { logInFunc, signingUp, logIn } = useGlobalContext();

  return (
    <div className="log">
      <form
        className="form"
        onSubmit={(e) => {
          e.preventDefault();
          fetchDataBase({
            uname: e.target.uname.value,
            password: e.target.psw.value,
          });
        }}
      >
        <div className="formdiv">
          <label htmlFor="uname">
            <b>Username</b>
          </label>
          <input type="text" placeholder="Enter Username" name="uname" />
          <br />

          <label htmlFor="psw">
            <b>Password</b>
          </label>
          <input type="password" placeholder="Enter Password" name="psw" />
          <br />
          <button type="submit" className="button">
            Login
          </button>
          <br />
          <button type="button" onClick={signingUp} className="cancelbtn">
            Sign Up
          </button>
        </div>
      </form>
    </div>
  );
};
